import './Navbar.css';

export default function Navbar(){
    return (
        <div>
            <div className='navbar'>
                <a href="#home">Home</a>
                div<a href="#account" className='align'>Account</a>
                <a href="#contact">Contact</a>
                <a href='#bestsellers'>BestSelled</a>
            </div>
        </div>
    )
}
